<textarea id=check0textarea>
model HigherIndexElectrical
  parameter Real C1 = 1, C2 = 2, R = 10, p = 1.0;
  Real u1(start = 1.0), u2(start = 1.1), i0, i1, i2, u0;
equation
  u0 = sin(time);
  C1 * der(u1) = i1;
  C2 * der(u2) = i2;
  u1 = p * u2;
  i0 = i1 + i2;
  u0 = R * i0 + u1;
end HigherIndexElectrical;
</textarea>  <div id=check0div> </div> <br>
